import{_ as i,c as t,o as l,ae as o}from"./chunks/framework.Cthp9TdA.js";const u=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"08_工程化/git常用命令.md","filePath":"08_工程化/git常用命令.md"}'),a={name:"08_工程化/git常用命令.md"};function c(d,e,r,n,g,h){return l(),t("div",null,e[0]||(e[0]=[o('<h4 id="一、-初始化与配置" tabindex="-1">一、 初始化与配置 <a class="header-anchor" href="#一、-初始化与配置" aria-label="Permalink to &quot;一、 初始化与配置&quot;">​</a></h4><ul><li><code>git init</code>: 初始化一个新的 Git 仓库。</li><li><code>git config --global user.name &quot;Your Name&quot;</code>: 设置全局用户名。</li><li><code>git config --global user.email &quot;your.email@example.com&quot;</code>: 设置全局邮箱。</li></ul><h4 id="二、-克隆与更新" tabindex="-1">二、 克隆与更新 <a class="header-anchor" href="#二、-克隆与更新" aria-label="Permalink to &quot;二、 克隆与更新&quot;">​</a></h4><ul><li><code>git clone &lt;repository_url&gt;</code>: 克隆远程仓库到本地。</li><li><code>git fetch</code>: 从远程仓库下载最新的提交，但不自动合并到当前分支。</li><li><code>git pull</code>: 从远程仓库下载最新的提交并合并到当前分支。</li></ul><h4 id="三、-提交与修改" tabindex="-1">三、 提交与修改 <a class="header-anchor" href="#三、-提交与修改" aria-label="Permalink to &quot;三、 提交与修改&quot;">​</a></h4><ul><li><code>git add &lt;file&gt;</code>: 将指定文件添加到暂存区。</li><li><code>git add .</code>: 将所有修改过的文件添加到暂存区。</li><li><code>git commit -m &quot;commit message&quot;</code>: 提交暂存区的修改，并添加提交信息。</li><li><code>git commit -a -m &quot;commit message&quot;</code>: 跳过暂存区，直接提交所有修改，并添加提交信息。</li><li><code>git status</code>: 查看工作区和暂存区的状态。</li><li><code>git diff</code>: 查看工作区和暂存区的差异。</li><li><code>git rm &lt;file&gt;</code>: 从版本库中删除指定文件。</li><li><code>git mv &lt;old_file&gt; &lt;new_file&gt;</code>: 重命名或移动文件。</li></ul><h4 id="四、-分支操作" tabindex="-1">四、 分支操作 <a class="header-anchor" href="#四、-分支操作" aria-label="Permalink to &quot;四、 分支操作&quot;">​</a></h4><ul><li><code>git branch</code>: 查看本地分支列表。</li><li><code>git branch &lt;branch_name&gt;</code>: 创建一个新的分支。</li><li><code>git checkout &lt;branch_name&gt;</code>: 切换到指定分支。</li><li><code>git checkout -b &lt;branch_name&gt;</code>: 创建并切换到新的分支。</li><li><code>git merge &lt;branch_name&gt;</code>: 将指定分支合并到当前分支。</li><li><code>git branch -d &lt;branch_name&gt;</code>: 删除指定分支（已合并）。</li><li><code>git branch -D &lt;branch_name&gt;</code>: 强制删除指定分支（未合并）。</li></ul><h4 id="五、-版本回溯" tabindex="-1">五、 版本回溯 <a class="header-anchor" href="#五、-版本回溯" aria-label="Permalink to &quot;五、 版本回溯&quot;">​</a></h4><ul><li><code>git log</code>: 查看提交历史。</li><li><code>git log --oneline</code>: 以简洁的单行格式查看提交历史。</li><li><code>git show &lt;commit_id&gt;</code>: 查看指定提交的详细信息。</li><li><code>git revert &lt;commit_id&gt;</code>: 撤销指定提交的更改，并创建一个新的提交。</li><li><code>git reset &lt;commit_id&gt;</code>: 将当前分支的指针移动到指定提交，可以选择保留或丢弃之前的提交。</li></ul><h4 id="六、-远程仓库操作" tabindex="-1">六、 远程仓库操作 <a class="header-anchor" href="#六、-远程仓库操作" aria-label="Permalink to &quot;六、 远程仓库操作&quot;">​</a></h4><ul><li><code>git remote add origin &lt;repository_url&gt;</code>: 添加远程仓库。</li><li><code>git remote -v</code>: 查看远程仓库信息。</li><li><code>git push origin &lt;branch_name&gt;</code>: 将本地分支推送到远程仓库。</li><li><code>git push -u origin &lt;branch_name&gt;</code>: 将本地分支推送到远程仓库，并建立关联。</li></ul><h4 id="七、-其他" tabindex="-1">七、 其他 <a class="header-anchor" href="#七、-其他" aria-label="Permalink to &quot;七、 其他&quot;">​</a></h4><ul><li><code>git help &lt;command&gt;</code>: 查看指定命令的帮助信息。</li></ul>',14)]))}const s=i(a,[["render",c]]);export{u as __pageData,s as default};
